import React from 'react'
import styled from 'styled-components'

import { Grid,IngrendientsDiv,Ingrendients } from './Food'

const FoodContainer = styled.div`
height: min-content;
border: 1px solid black;
margin: 2px;
`

const Title = styled.h3`
  color: #ffff;
`

const Img = styled.img`
  width: 20px;
  height: 20px;
`

function FoodsList(props) {
  return (
    <div>
      <FoodContainer> 
      <Title>{props.title}</Title>
      <Grid>
        <Img src={props.img}></Img>
        <IngrendientsDiv>
           {/* {props.ingrendients.length === 0 ? 
            <div>
              <h4>No Ingredients</h4>
            </div>
           : props.ingrenndients.map((item,i)=>{
              return(
                <Ingrendients key={i}>{item}</Ingrendients>
              )
          })}  */}

             {/* {props.ingrendients.map((item,i)=>{
               return(
                 <Ingrendients key={i}>{item}</Ingrendients>
               )
             })} */}
        </IngrendientsDiv> 
        <h3>{props.price}</h3>
      </Grid>
        
      </FoodContainer>
     

     
    </div>
  )
}

export default FoodsList
